using WalkingForRochester.Views;using Xamarin.Forms;namespace WalkingForRochester{    public partial class AppShell : Shell    {        public AppShell()        {            InitializeComponent();            Routing.RegisterRoute(nameof(AboutPage), typeof(AboutPage));            Routing.RegisterRoute(nameof(ContactInformationPage), typeof(ContactInformationPage));            Routing.RegisterRoute(nameof(LeaderboardPage), typeof(LeaderboardPage));            Routing.RegisterRoute(nameof(NewsFeedPage), typeof(NewsFeedPage));            Routing.RegisterRoute(nameof(WalkPage), typeof(WalkPage));            Routing.RegisterRoute(nameof(ArticlePage), typeof(ArticlePage));            Routing.RegisterRoute(nameof(WasteManagementProtocolPage), typeof(WasteManagementProtocolPage));            Routing.RegisterRoute(nameof(UserProfilePage), typeof(UserProfilePage));            Routing.RegisterRoute(nameof(EditPage), typeof(EditPage));        }    }}